	for (i=0; i<50; i++) ring['col'+i]=new Array();
	add_blobs();
	setTimeout('zoomer()', speed);
}

function add_blobs() {
    var f, h, i, j, k, w;
	for (i=15; i<swide*1.5;) {
		f=Math.floor(5+45*(i/swide)); 
		ring['row'+count]=new Array();
		for (j=0; j<50; j++) {

		  ring['col'+j][count]=k;
		  div.appendChild(k);

		count++;
		i+=2.2*f;
	}
	nour=count;
}

function zoomer() {
   for (var i=0; i<50; i++) {
     var tc=Math.abs(i-nour+roun)%colsel.length;

   }
   if (++roun==count) {
     roun=0;
	 nour++;
	 setTimeout('zoomer()', speed);
   }
   else zoomer();
